import React, { useEffect, useRef, useState } from 'react';
import axios from 'axios';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  TimeScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  LineController
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  TimeScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  LineController
);

// Fungsi untuk menghasilkan nomor pesanan otomatis
const generateOrderNumber = () => {
  const now = new Date();
  const year = now.getFullYear().toString().slice(-2); 
  const month = (now.getMonth() + 1).toString().padStart(2, '0'); 
  const day = now.getDate().toString().padStart(2, '0');
  const hours = now.getHours().toString().padStart(2, '0');
  const minutes = now.getMinutes().toString().padStart(2, '0');
  const seconds = now.getSeconds().toString().padStart(2, '0');
  const random = Math.floor(Math.random() * 1000).toString().padStart(3, '0'); 

  return `PO-${year}${month}${day}-${hours}${minutes}${seconds}-${random}`; 
};

const DashboardAdmin = () => {
  const [orders, setOrders] = useState([]);
  const [users, setUsers] = useState([]);
  const chartRef = useRef(null);
  const chartInstance = useRef(null);

  useEffect(() => {
    fetchOrderData();
    fetchUserData();
    return () => {
      if (chartInstance.current) {
        chartInstance.current.destroy();
      }
    };
  }, []);

  const fetchOrderData = async () => {
    try {
      const response = await axios.get('http://localhost:5000/orders');
      const orders = response.data;

      // Tambahkan nomor pesanan ke setiap pesanan baru
      const ordersWithNumber = orders.map(order => ({
        ...order,
        nomorPesanan: generateOrderNumber(), 
      }));

      setOrders(ordersWithNumber);

      const groupedOrders = ordersWithNumber.reduce((acc, order) => {
        const date = new Date(order.date).toLocaleDateString();
        if (!acc[date]) {
          acc[date] = [];
        }
        acc[date].push(order);
        return acc;
      }, {});

      const dates = Object.keys(groupedOrders);
      const orderCounts = dates.map(date => groupedOrders[date].length);

      if (chartInstance.current) {
        chartInstance.current.destroy();
      }

      const ctx = chartRef.current.getContext('2d');
      chartInstance.current = new Chart(ctx, {
        // ... (konfigurasi grafik sama seperti sebelumnya)
      });
    } catch (error) {
      console.error('Error fetching order data:', error);
    }
  };

  const fetchUserData = async () => {
    try {
      const response = await axios.get('http://localhost:5000/users');
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  return (
    <div className="container mx-auto p-5 mt-5">
      {/* ... (bagian dashboard lainnya) ... */}

      <div className="bg-white p-4 rounded-lg shadow-md mt-4 overflow-x-auto"> 
        <h3 className="text-xl font-semibold mb-2">Recent Orders</h3>
        <table className="w-full table-auto"> 
          <thead>
            <tr>
              <th className="px-4 py-2">No. Pesanan</th>
              <th className="px-4 py-2">Nama Barang</th>
              <th className="px-4 py-2">Harga Beli</th>
              <th className="px-4 py-2">Tanggal</th>
            </tr>
          </thead>
          <tbody>
            {orders.slice(0, 5).map(order => (
              <tr key={order.id}>
                <td className="border px-4 py-2">{order.nomorPesanan}</td>
                <td className="border px-4 py-2">{order.namaBarang}</td>
                <td className="border px-4 py-2">{order.hargaBeli}</td>
                <td className="border px-4 py-2">{new Date(order.date).toLocaleDateString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="bg-white p-4 rounded-lg shadow-md mt-4">
        <h3 className="text-xl font-semibold mb-2">Order Chart</h3>
        <OrderChart /> 
      </div>

      {/* ... (bagian dashboard lainnya) ... */}
    </div>
  );
};

// ... (komponen OrderChart sama seperti sebelumnya)

export default DashboardAdmin;
